import React from 'react';
import './App.css';

function Board() {
  let board = []

  for(let i=0; i<=3; i++){
    let children = []
    for(let j=0; j<=3; j++){
      children.push(<div id={j} class='square' />)
      }
    board.push(<div class='board-row'>{children}</div>)
  }
  return board;
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Board/>
      </header>
    </div>
  );
}

export default App;
